import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import EditNote from './EditNote';
import Layout from './Layout';

function App({ activeNote }) {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Layout />}>
          <Route path="/:noteId" element={<Layout />}>
            <Route path="/:noteId/edit" element={<EditNote activeNote={activeNote} />} />
          </Route>
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
